import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'react-bootstrap';
import Header from './header.js';
import Footer from './footer';
const App = () => {
  return (
    <Container>
      <Row>
        <Header />
        <Footer />
      </Row>
    </Container>
  );
}



export default App;
